import '../App.css';
import React from 'react';
import { Container } from 'semantic-ui-react';

import MatchCard from './matchCard';
import PageHeader from '../pageHeader';

const Home = (props) => {

   const fixtures = props.fixtures.map(fixture => {
      return <MatchCard fixture={fixture} />
   });

    return(
       <Container className="App">
            <Container className='border'>
               <PageHeader title={`Game Week ${props.round}`} updateRound={props.updateRound} round={props.round}/>
               <Container>{fixtures}</Container>
               <PageHeader updateRound={props.updateRound} round={props.round}/>
            </Container>
       </Container>
    );
}

export default Home;
